import headerLogo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="header page__header">
        <a href="#" target="_self"><img className="header__logo" src={headerLogo}
          alt="Логотип Место" /></a>
      </header>
    </div>
  );
}

export default App;
